import React from 'react'
import { Container, Input } from 'semantic-ui-react';

function App() {
  return (
    <Container>
      <Input placeholder="First Name" />
      <Input placeholder="Last Name" />
      <Input placeholder="E-mail" />
    </Container>
  );
}

export default App;
